var myInt, all_blocks ;

function load_layout(){
	if(!sessionStorage.getItem("name")){
		window.location.replace("/index.html");
	}else{
		document.getElementById("top").innerHTML = "Welcome, "+sessionStorage.getItem("name")+"<br/>";
		document.getElementById("top").innerHTML += '<table class="left" border="0"><tr><td><b>Student Name</b></td><td><span id="stud_name">: '+sessionStorage.getItem("name")+'</span></td></tr><tr><td><b>Student ID</b></td><td><span id="stud_id">: '+sessionStorage.getItem("studentid")+'</span></td></tr><tr><td><b>Study Program</b></td><td><span id="stud_major">: '+sessionStorage.getItem("major")+'</span></td></tr></table>';
		check_reservation();
	}
}

function logout(){
	xmlhttp = new XMLHttpRequest();
	xmlhttp.onreadystatechange = function(){
		if (this.readyState == 4 && this.status == 200) {
			sessionStorage.clear();
			window.location.replace("/index.html");
		} else if(this.readyState == 4 && this.status == 400){
			alert("Bad Request: Request is malformed.");
			window.location.replace("/index.html");
		} else if(this.readyState == 4 && this.status == 401){
			alert("Unauthorized: Authentication failed.");
			window.location.replace("/index.html");
		} else if(this.readyState == 4 && this.status == 500){
			alert("Internal Server Error: Back-end error.");
			window.location.replace("/index.html");
		}
	};
	xmlhttp.open("GET", "/api/auth/destroy", true);
	//xmlhttp.open("GET", "/php/api_auth_destroy.txt", false);
	xmlhttp.send(); 
}

function check_reservation(){
	xmlhttp = new XMLHttpRequest();
	xmlhttp.onreadystatechange = function(){
		if (this.readyState == 4 && this.status == 200) {
			var myObj = JSON.parse(this.responseText);
			if(myObj.reservation_info.limit_reached==true){
				//fixed
				//alert("fixed");
				document.getElementById("my_reservation").innerHTML = '<h3 class="center">My Reservation</h3><b>You have made seat reservation as shown in the table below.</b><table class="center" border="1"><tr><th colspan="2"><span id="number_booked">'+myObj.current_seating.position.name+'</span></th></tr><tr><th>Floor</th><td><span id="floor_booked">'+(myObj.current_seating.block.level+1)+'</span></td></tr><tr><th>Block</th><td><span id="block_booked">'+myObj.current_seating.block.name+'</span></td></tr><tr><th>Row</th><td><span id="row_booked">'+(myObj.current_seating.position.y+1)+'</span></td></tr><tr><th>Column</th><td><span id="column_booked">'+(myObj.current_seating.position.x*2+1)+', '+(myObj.current_seating.position.x*2+2)+'</span></td></tr></table><br/><button id="download_res" class="download_res" onclick="download_res('+"'"+myObj.current_seating.position.name+"'"+','+(myObj.current_seating.block.level+1)+','+"'"+myObj.current_seating.block.name+"'"+','+(myObj.current_seating.position.y+1)+','+"'"+(myObj.current_seating.position.x*2+1)+', '+(myObj.current_seating.position.x*2+2)+"'"+','+"'"+myObj.reservation_info.last_update+"'"+')">Download</button>';
			}else{
				if(myObj.current_seating==null){
					//null
					//alert("null");
					request_all_blocks().then((blocks) => {
						load_blocks(blocks);
						document.getElementById("my_reservation").innerHTML = '<span><b>You have not made any reservation. Please do so by choosing any available desirable block and a pair of seats below.</b></span>';
					});
				}else{
					//changeable
					//alert("changeable");
					request_all_blocks().then((blocks) => {
						load_blocks(blocks);
						document.getElementById("my_reservation").innerHTML = '<h3 class="center">My Reservation</h3><b>You have made seat reservation as shown in the table below.</b><table class="center" border="1"><tr><th colspan="2"><span id="number_booked">'+myObj.current_seating.position.name+'</span></th></tr><tr><th>Floor</th><td><span id="floor_booked">'+(myObj.current_seating.block.level+1)+'</span></td></tr><tr><th>Block</th><td><span id="block_booked">'+myObj.current_seating.block.name+'</span></td></tr><tr><th>Row</th><td><span id="row_booked">'+(myObj.current_seating.position.y+1)+'</span></td></tr><tr><th>Column</th><td><span id="column_booked">'+(myObj.current_seating.position.x*2+1)+', '+(myObj.current_seating.position.x*2+2)+'</span></td></tr></table><br/><span><b>You have made seat reservation.<br/>You can optionally change your reservation by choosing any available desirable block and a pair of seats below.</b></span><hr/>';
					});
				}
			}
		} else if(this.readyState == 4 && this.status == 400){
			alert("Bad Request: Request is malformed.");
			logout();
		} else if(this.readyState == 4 && this.status == 401){
			alert("Unauthorized: Not authenticated.");
			logout();
		} else if(this.readyState == 4 && this.status == 500){
			alert("Internal Server Error: Back-end error.");
			logout();
		}
	};
	xmlhttp.open("GET", "/api/reservation", true);
	//xmlhttp.open("GET", "/php/api_reservation_changeable.txt", false);
	//xmlhttp.open("GET", "/php/api_reservation_fixed.txt", false);
	//xmlhttp.open("GET", "/php/api_reservation_null.txt", false);
	xmlhttp.send(); 
}

