function load_blocks(blocks){
	clearInterval(myInt);
	document.getElementById("seat_selection").innerHTML = "";
	document.getElementById("layout").innerHTML = '<h3>Please choose a block:</h3><button id="stage" class="stage">STAGE</button><hr/><table class="center" border="0"><tr><th colspan="4"><br/><button class="graduates">GRADUATES</button></th></tr><tr><th colspan="4">1ST FLOOR</th></tr><tr><td><button id="A" class="block_button_front" onclick="choose_block('+"'1'"+')">BLOCK A</button></td><td><button id="B" class="block_button_front" onclick="choose_block('+"'2'"+')">BLOCK B</button></td><td><button id="C" class="block_button_front" onclick="choose_block('+"'3'"+')">BLOCK C</button></td><td><button id="D" class="block_button_front" onclick="choose_block('+"'4'"+')">BLOCK D</button></td></tr><tr><td><button id="E" class="block_button_mid" onclick="choose_block('+"'5'"+')">BLOCK E</button></td><td><button id="F" class="block_button_mid" onclick="choose_block('+"'6'"+')">BLOCK F</button></td><td><button id="G" class="block_button_mid" onclick="choose_block('+"'7'"+')">BLOCK G</button></td><td><button id="H" class="block_button_mid" onclick="choose_block('+"'8'"+')">BLOCK H</button></td></tr><tr><td><button id="I" class="block_button_back" onclick="choose_block('+"'9'"+')">BLOCK I</button></td><td><button id="J" class="block_button_back" onclick="choose_block('+"'10'"+')">BLOCK J</button></td><td><button id="K" class="block_button_back" onclick="choose_block('+"'11'"+')">BLOCK K</button></td><td></td></tr><tr><th colspan="4">2ND FLOOR</th></tr><tr><td><button id="L" class="block_button_up" onclick="choose_block('+"'12'"+')">BLOCK L</button></td><td><button id="M" class="block_button_up" onclick="choose_block('+"'13'"+')">BLOCK M</button></td><td><button id="N" class="block_button_up" onclick="choose_block('+"'14'"+')">BLOCK N</button></td><td><button id="O" class="block_button_up" onclick="choose_block('+"'15'"+')">BLOCK O</button></td></tr></table>';
}

function choose_block(block){
	document.getElementById("layout").innerHTML = "";
	clearInterval(myInt);
	request_block(block);
	myInt = setInterval(function(){ choose_block(block); }, 5000);
}

function request_block(tblock){
	var xmlhttp = new XMLHttpRequest(), send_this = JSON.stringify({"block_id": tblock});
	xmlhttp.onreadystatechange = function() {
		if (this.readyState == 4 && this.status == 200) {
			for (var i = 0; i < all_blocks.blocks.length; i++) {
				if(tblock==all_blocks.blocks[i].id){
					print_block(JSON.parse(this.responseText),all_blocks.blocks[i].attributes.dimension[0],all_blocks.blocks[i].attributes.dimension[1],tblock);
					break;
				}
			} 
		} else if(this.readyState == 4 && this.status == 400){
			alert("Bad Request: Request is malformed.");
			logout();
		} else if(this.readyState == 4 && this.status == 401){
			alert("Unauthorized: Not authenticated.");
			logout();
		} else if(this.readyState == 4 && this.status == 500){
			alert("Internal Server Error: Back-end error.");
			logout();
		}
	};
	xmlhttp.open("GET", "/api/layout/block?id="+encodeURIComponent(tblock), true);
	//xmlhttp.open("GET", "/php/api_layout_block.txt", false);
	xmlhttp.send(send_this); 
}

function request_all_blocks(callback){
	return new Promise((resolve, reject) => {
		var xmlhttp = new XMLHttpRequest();
		xmlhttp.onreadystatechange = function() {
			if (this.readyState == 4 && this.status == 200) {
				all_blocks = JSON.parse(this.responseText);
				resolve(all_blocks);
			} else if(this.readyState == 4 && this.status == 400){
				alert("Bad Request: Request is malformed.");
				logout();
			} else if(this.readyState == 4 && this.status == 401){
				alert("Unauthorized: Not authenticated.");
				logout();
			} else if(this.readyState == 4 && this.status == 500){
				alert("Internal Server Error: Back-end error.");
				logout();
			}
		};
		xmlhttp.open("GET", "/api/layout", true);
		//xmlhttp.open("GET", "/php/api_layout.txt", false);
		xmlhttp.send();
	});
}

function print_block(sel_block,drow,dcol,dblock){
	var i,j,k;
	document.getElementById("seat_selection").innerHTML = '<h3>Please choose a pair of seats:</h3><button id="stage" class="stage">STAGE</button><hr/>';
	for (i = 0; i < drow; i++) {
		document.getElementById("seat_selection").innerHTML += "<br/>";
		for (j = 0; j < dcol; j++) {
			for (k = 0; k < sel_block.positions.length; k++) {
				if(sel_block.positions[k].x==j && sel_block.positions[k].y==i){
					if(sel_block.positions[k].secret_identifier.length==0){
						//not reserved
						document.getElementById("seat_selection").innerHTML += '<img src="/img/empty.png" onclick="select_seat'+"("+i+","+j+","+dblock+",'"+sel_block.positions[k].name+"')"+'" height=45px" title="'+sel_block.positions[k].name+'"/>';
					}else{
						if(sel_block.positions[k].secret_identifier==":SYSTEM_RESERVED"){
							//cum laude
							document.getElementById("seat_selection").innerHTML += '<img src="/img/cumlaude.png" onclick="alert('+"'These seats have been reserved for cum-laude students. Please choose other seats.'"+')" height=45px" title="'+sel_block.positions[k].name+'"/>';
						}else{
							//reserved
							document.getElementById("seat_selection").innerHTML += '<img src="/img/locked.png" onclick="alert('+"'These seats have been reserved. Please choose other seats.'"+')" height=45px" title="'+sel_block.positions[k].name+'"/>';
						}
					}
					break;
				}
 			}
 		}
 	}
	document.getElementById("seat_selection").innerHTML += "<br/><button id='close' onclick='load_blocks()'>Return to Blocks</button>";
}

function select_seat(r,c,b,n){
	var r = confirm("Do you want to select "+n+" as your seats? The selection will be saved if you click OK.");
	if(r == true){
		alert("Requesting "+n+"...");
		var xmlhttp = new XMLHttpRequest(), res = JSON.stringify({block_id:b,x:r,y:c});
		xmlhttp.onreadystatechange = function() {
			if (this.readyState == 4 && this.status == 200) {
				alert("Request successful. "+n+" have been reserved for you.");
				window.location.replace("/main_page.html");
			} else if(this.readyState == 4 && this.status == 400){
				alert("Bad Request: Request is malformed.");
				logout();
			} else if(this.readyState == 4 && this.status == 401){
				alert("Unauthorized: Not authenticated.");
				logout();
			} else if(this.readyState == 4 && this.status == 500){
				alert("Internal Server Error: Back-end error.");
				logout();
			}else if(this.readyState == 4 && this.status == 404){
				alert("Not Found: Seating location not found.");
				logout();
			} else if(this.readyState == 4 && this.status == 429){
				alert("Too Many Requests: Reserve limit reached.");
				logout();
			}
		};
		xmlhttp.open("POST", "/api/reservation", true);
		//xmlhttp.open("POST", "/php/api_reservation_post.txt", false);
		xmlhttp.send(res); 
	}
}